import "./App.css";

function App() {
  return (
    <div className="App">
      <Grid container spacing={2} justify="center">
        <form>
          What was I supposed to do?
          <input
            className="bigForm"
            type="textarea"
            name="textValue"
            rows={5}
            cols={5}
          />
        </form>
      </Grid>
    </div>
  );
}

export default App;
